export default {
  name: 'assertions-detail',
  props: {
    result: {
      type: Array
    }
  },
  watch: {
    result() {
      this.getResult()
    }
  },
  mounted() {
    this.getResult()
  },
  data() {
    return {
      compare_list: {
        1: '相等',
        2: '包含',
        3: '不为空或null'
      }
    }
  },
  methods: {
    getResult() {
      this.result.forEach(e => {
        e.compare_value = this.compare_list[e.compare_type]
        e.extract_value = e.extract_success ? '通过' : '失败'
      })
    }
  }
}
